import React from "react";
import Dropdown from "bootstrap/js/dist/dropdown";
interface IProps {}


let DropDownList:React.FC<IProps> =() =>{

    return(
        <React.Fragment>
            <div className="dropdown show">
                <a className="btn btn-secondary dropdown-toggle" href="#" role="button" id="dropdownMenuLink"
                   data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    Select Streams
                </a>
                <ul className="dropdown-menu" aria-labelledby="dropdownMenuLink">
                    <li><a className="dropdown-item" href="">Science</a></li>
                    <li><a className="dropdown-item" href="#">Commerce</a></li>
                    <li className="dropdown-submenu"><a className="dropdown-item dropdown-toggle" href="#">Arts</a>
                        <ul className="dropdown-menu">
                            <li><a className="dropdown-item" href="#">History</a></li>
                            <li><a className="dropdown-item" href="#">Geography</a></li>
                            <li><a className="dropdown-item" href="#">Sociology</a></li>

                        </ul>
                    </li>
                </ul>
            </div>
        </React.Fragment>
    )
};
export default DropDownList;
